function extrairNumeroDaCompra(url: string): string | null {
    const match = url.match(/compra=(\d+)/);
    return match ? match[1] : null;
    }

function criarDicionarioUnidades(listaJson) {
    const dicionarioUnidades = {};
  
    listaJson.forEach(json => {
        const numeroItem = json.numeroItem;
        const unidadeMedida = json.unidadeMedida;
    
        dicionarioUnidades[numeroItem] = unidadeMedida;
    });
  
    return dicionarioUnidades;
}

